class Solution:
    # bfs is better than dfs
    def shortestPathBinaryMatrix(self, grid: List[List[int]]) -> int:
        ans = 10001 # max number with regard to this problem
        if not grid or grid[0][0] == 1:
            return -1
        rows, columns = len(grid), len(grid[0])
        queue = collections.deque() # bfs
        queue.append((0,0,1))
        while queue:
            x, y, path = queue.popleft()
            if x==y==rows-1:
                ans = path
                break
            adjacent = [(x+1,y),(x-1,y),(x,y+1),(x,y-1),(x+1,y+1),(x+1,y-1),(x-1,y+1),(x-1,y-1)]
            for i,j in adjacent:
                if 0<=i<rows and 0<=j<columns and grid[i][j] == 0:
                    queue.append((i,j,path+1))
                    grid[i][j] = 'X'
        return ans if ans<10001 else -1
s = Solution()
print(s.shortestPathBinaryMatrix(grid))                    